    <div class="content">
        <h1 id="introduction">Introduction</h1>
<p>10MG API provides comprehensive endpoints for e-commerce operations, user management, credit/BNPL services, and business integrations. The API supports role-based access control for Admin, Vendor, Supplier, Lender, and Storefront users.</p>
<aside>
    <strong>Base URL</strong>: <code>http://localhost</code>
</aside>
<p>This documentation provides comprehensive information about the 10MG API, including authentication, endpoints, request/response formats, and code examples.</p>
<h2 id="authentication">Authentication</h2>
<p>Most endpoints require authentication using OAuth2 Bearer tokens via Laravel Passport. Authenticate by making a request to the authentication endpoint to receive an access token, then include it in the <code>Authorization</code> header for subsequent requests.</p>
<h2 id="api-versioning">API Versioning</h2>
<p>This API is versioned and currently uses <strong>v1</strong>. All endpoints are prefixed with <code>/api/v1/</code>.</p>
<h2 id="rate-limiting">Rate Limiting</h2>
<p>Some endpoints may be rate-limited. Check response headers for rate limit information.</p>
<aside>As you scroll, you'll see code examples for working with the API in different programming languages in the dark area to the right (or as part of the content on mobile).
You can switch the language used with the tabs at the top right (or from the nav menu at the top left on mobile).</aside>

        <h1 id="authenticating-requests">Authenticating requests</h1>
<p>To authenticate requests, include an <strong><code>Authorization</code></strong> header with the value <strong><code>"Bearer {YOUR_AUTH_TOKEN}"</code></strong>.</p>
<p>All authenticated endpoints are marked with a <code>requires authentication</code> badge in the documentation below.</p>
<p>This API uses Laravel Passport (OAuth2) for authentication. Obtain your access token by logging in through the authentication endpoint. Include the token in the Authorization header as: <code>Authorization: Bearer {token}</code></p>

        <h1 id="endpoints">Endpoints</h1>

    

                                <h2 id="endpoints-POSTapi-v1-integration-vendor-ecommerce-transactions">This controller is intended to handle vendor ecommerce transactions.</h2>

<p>
<small class="badge badge-darkred">requires authentication</small>
</p>

<p>for credit scoring.</p>

<span id="example-requests-POSTapi-v1-integration-vendor-ecommerce-transactions">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request POST \
    "http://localhost/api/v1/integration/vendor/ecommerce-transactions" \
    --header "Authorization: Bearer {YOUR_AUTH_TOKEN}" \
    --header "Content-Type: application/json" \
    --header "Accept: application/json" \
    --data "{
    \"email\": \"van.lueilwitz@example.net\"
}"
</code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "http://localhost/api/v1/integration/vendor/ecommerce-transactions"
);

const headers = {
    "Authorization": "Bearer {YOUR_AUTH_TOKEN}",
    "Content-Type": "application/json",
    "Accept": "application/json",
};

let body = {
    "email": "van.lueilwitz@example.net"
};

fetch(url, {
    method: "POST",
    headers,
    body: JSON.stringify(body),
}).then(response =&gt; response.json());</code></pre></div>


<div class="php-example">
    <pre><code class="language-php">$client = new \GuzzleHttp\Client();
$url = 'http://localhost/api/v1/integration/vendor/ecommerce-transactions';
$response = $client-&gt;post(
